import { fakeAuth } from "../../util/fakeAuth";
import HeaderIn from "./HeaderIn";
import HeaderOut from "./HeaderOut";

const Header = withRouter(({ history }) => (
    fakeAuth.isAuthenticated ? (
        <HeaderIn />
    ) : (
        <HeaderOut />
    )
))
